cl_int clGetPlatformInfoString(cl_platform_id obj, cl_platform_info what, char **s_out, size_t *slen_out) {
  cl_int err = 0;
  size_t sz = 100, real_sz;
  char *out = calloc(1, sz), *safety_first;
  while (clGetPlatformInfo(obj, what, sz, out, &real_sz) == -30) {
    safety_first = realloc(out, sz * 2);
    if (safety_first == NULL) {
      err = -6;
      goto catch;
    }
    out = safety_first;
    sz *= 2;
  }

  if (real_sz > CL_INT_MAX) {
    err = -30;
    goto catch;
  }

  *s_out = out;
  *slen_out = real_sz;
  return 0;

 catch:
  *s_out = NULL;
  *slen_out = 0;
  free(out);
  return err;
}


